INSERT INTO `bravo_locations` (`id`, `name`, `content`, `slug`, `image_id`, `map_lat`, `map_lng`, `map_zoom`, `status`, `_lft`, `_rgt`, `parent_id`, `create_user`, `update_user`, `deleted_at`, `origin_id`, `lang`, `created_at`, `updated_at`, `banner_image_id`, `trip_ideas`) VALUES
(1, 'Paris', '<p>Paris is the capital of France, where tourists are commonplace. Millions of people dream to go to Paris. Our website will try to help with accommodation in this beautiful city.</p>', 'paris', 251, '48.856613', '2.352222', 13, 'publish', 16, 17, 9, 1, 1, NULL, NULL, NULL, '2022-04-14 05:22:04', '2022-04-14 10:26:43', 250, '[{\"image_id\":\"252\",\"title\":\"Arc de Triomphe\",\"link\":\"#\",\"content\":\"A landmark to which our team of web developers from the f2i school, advises going and take pictures as a memento.\"},{\"image_id\":\"253\",\"title\":\"Louvre\",\"link\":\"#\",\"content\":\"This museum is known all over the world. So just go there, and dive headfirst into the history of all mankind.\"}]'),
(9, 'France', '<p>France. A country of contrasts and beauty. It is worth to go here if you like a good and high-quality vacation.</p>\r\n<p>&nbsp;</p>\r\n<p>Test category for the project f2i</p>', 'france', 249, NULL, NULL, 8, 'publish', 15, 18, NULL, 1, 1, NULL, NULL, NULL, '2022-04-14 10:17:25', '2022-04-14 10:18:31', 249, NULL);
INSERT INTO `bravo_location_translations` (`id`, `origin_id`, `locale`, `name`, `content`, `create_user`, `update_user`, `created_at`, `updated_at`, `trip_ideas`) VALUES
(1, 9, 'fr', 'France', '<p>France. Une terre de contrastes et de beauté. Cela vaut la peine de s\'y rendre si vous aimez les vacances de qualité.</p>\n<p> </p>\n<p>Catégorie de test pour le projet f2i</p>', 1, NULL, '2022-04-14 10:18:47', '2022-04-14 10:18:47', NULL),
(2, 1, 'fr', 'Paris', '<p>Paris est la capitale de la France, où les touristes sont monnaie courante. Des millions de personnes rêvent de se rendre à Paris. Notre site web essaiera de vous aider à trouver un hébergement dans cette belle ville.</p>', 1, NULL, '2022-04-14 10:27:51', '2022-04-14 10:27:51', '[{\"image_id\":\"252\",\"title\":\"Arc de Triomphe\",\"link\":\"#\",\"content\":\"Un point de rep\\u00e8re auquel notre \\u00e9quipe de d\\u00e9veloppeurs web de l\'\\u00e9cole f2i, conseille d\'aller et de prendre des photos en guise de souvenir.\"},{\"image_id\":\"253\",\"title\":\"Louvre\",\"link\":\"#\",\"content\":\"Ce mus\\u00e9e est connu dans le monde entier. Il suffit donc d\'y aller, et de plonger la t\\u00eate la premi\\u00e8re dans l\'histoire de toute l\'humanit\\u00e9.\"}]');
