INSERT INTO `bravo_service_translations` (`id`, `origin_id`, `locale`, `title`, `address`, `content`, `create_user`, `update_user`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 72, 'en', 'THE CLEMENT HOUSE', 'Porte de Vanves', '<p>The CLÉMENT house, in Vendée, is located 12 km from the sea.</p>\n<p>The domain offers an aquatic area, a paddling pool, water slides, free and private fishing on a 2 ha pond, adventure park in the trees and paintball, pony club, playground for children with a bouncy castle, etc. </p>', 1, NULL, '2022-05-03 12:52:05', '2022-05-03 12:52:05', NULL),
(4, 74, 'en', 'DOMAINE DES VAULX', 'Haras de la Poupardière 53240, La Baconnière', '<p>5 CABINS IN THE TREES including 1 family, 1 CABIN FLOTTANTE, 1 BUBBLE, 1 LOV\'NID SPA, 1 CABANE PERCHEE SPA on the road to BRITAIN at the gateway to NORMANDY. Located in Mayenne (53), in the heart of the Ernée valley, at La Baconnière, our accommodations are on the way to Mont St-Michel, Fougères, Vitré, Cancale, Saint-Malo.</p>\n<p>Do you want to be in the country ?</p>', 1, NULL, '2022-05-03 12:55:10', '2022-05-03 12:55:10', NULL),
(5, 71, 'en', 'L\'ECOLODGE', 'Gorges de Verdon', '<p>Vous allez être blottis dans des logements atypiques, au creux de la Nature, avec la faune et la flore.</p>', 1, NULL, '2022-05-03 12:57:22', '2022-05-03 12:57:22', NULL),
(6, 76, 'en', 'LA CHOUETTE CABANE', 'La basse bergerie, 53400, Pommerieux, Pays de la Loire', '<div style=\"white-space:pre-wrap;\"><span style=\"white-space:pre-wrap;\">25 hectares shared between various ponds, market gardens, green paths in the shade of trees. </span></div>\n<div style=\"white-space:pre-wrap;\"> </div>\n<div style=\"white-space:pre-wrap;\"><span style=\"white-space:pre-wrap;\">Gwendolyne will welcome you with joy in this haven of peace for a privileged moment spent between lovers, friends or family. Our cabins and caravans are fully insulated and heated for the winter, care is taken to the quality of the bedding, linen, refined decoration. Books and binoculars are at your disposal in your cabin. An exceptional place for the diversity of the fauna and the comfort of the accommodation.</span></div>', 1, NULL, '2022-05-03 12:59:34', '2022-05-03 12:59:34', NULL);
INSERT INTO `bravo_spaces` (`id`, `title`, `slug`, `content`, `image_id`, `banner_image_id`, `location_id`, `address`, `map_lat`, `map_lng`, `map_zoom`, `is_featured`, `gallery`, `video`, `faqs`, `price`, `sale_price`, `is_instant`, `allow_children`, `allow_infant`, `max_guests`, `bed`, `bathroom`, `square`, `enable_extra_price`, `extra_price`, `discount_by_days`, `status`, `default_state`, `create_user`, `update_user`, `deleted_at`, `created_at`, `updated_at`, `review_score`, `ical_import_url`, `min_day_before_booking`, `min_day_stays`, `enable_service_fee`, `service_fee`, `surrounding`) VALUES
(5, 'LA CHOUETTE CABANE', 'chouette-cabane', '<div style=\"white-space: pre-wrap;\">25 hectares partag&eacute;s entrent divers &eacute;tangs, mara&icirc;chages, chemins de verdures &agrave; l\'ombre des arbres.</div>\r\n<div style=\"white-space: pre-wrap;\">&nbsp;</div>\r\n<div style=\"white-space: pre-wrap;\">Gwendolyne vous y accueillera avec joie dans ce havre de paix pour un moment privil&eacute;gi&eacute; pass&eacute; entre amoureux, amis ou famille. Nos cabanes et roulotte sont enti&egrave;rement isol&eacute;es et chauff&eacute;es pour l&rsquo;hiver, le soin est apport&eacute; &agrave; la qualit&eacute; de la literie, du linge de lit en lin, de la d&eacute;coration raffin&eacute;e. Bouquins et jumelles sont &agrave; votre disposition dans votre cabane. Un lieu exceptionnel pour la diversit&eacute; de la Faune et le confort des logements.</div>', 263, 263, 9, 'La basse bergerie, 53400, Pommerieux, Pays de la Loire', '47.82542743789738', '-0.9201794663008118', 8, 1, '271,270,269,268,', NULL, NULL, 95.00, 0.00, NULL, 0, 0, 5, 10, 0, 171, NULL, '[{\"name\":\"Lawn garden\",\"name_en\":null,\"price\":\"100\",\"type\":\"one_time\"},{\"name\":\"Clearning\",\"name_en\":null,\"price\":\"100\",\"type\":\"one_time\"},{\"name\":\"Breakfasts\",\"name_en\":null,\"price\":\"200\",\"type\":\"one_time\"}]', NULL, 'publish', 1, 17, 1, NULL, '2022-04-14 05:22:07', '2022-05-03 12:59:51', 4.8, NULL, NULL, NULL, NULL, NULL, NULL),
(7, 'DOMAINE DES VAULX', 'domain-des-vaulx', '<p>5 CABANES DANS LES ARBRES dont 1 familiale, 1 CABANE FLOTTANTE, 1 BUBBLE, 1 LOV\'NID SPA, 1 CABANE PERCHEE SPA sur la route de la BRETAGNE aux portes de la NORMANDIE. Situ&eacute;es &agrave; Mayenne (53), au c&oelig;ur de la vall&eacute;e de l\'Ern&eacute;e, &agrave; la Baconni&egrave;re, nos h&eacute;bergements sont sur le chemin du Mont St-Michel, Foug&egrave;res, Vitr&eacute;, Cancale, Saint-Malo.</p>\r\n<p>Envie d&rsquo;&ecirc;tre bien &agrave; la campagne ?</p>', 264, 264, 9, 'Haras de la Poupardière 53240, La Baconnière', '48.17671', '-0.88705', 12, NULL, '267,266,265', NULL, NULL, 300.00, 125.00, NULL, 0, 0, 5, 6, 8, 128, 1, NULL, NULL, 'publish', 1, 18, 19, NULL, '2022-04-14 05:22:07', '2022-05-03 14:43:46', 3.0, NULL, NULL, NULL, NULL, NULL, NULL),
(9, 'LA MAISON CLEMENT', 'clement', '<p>La maison CL&Eacute;MENT, en Vend&eacute;e, est situ&eacute; &agrave; 12&thinsp;km de la mer.</p>\r\n<p>Le domaine propose un espace aquatique, une pataugeoire, toboggans aquatiques, p&ecirc;che gratuite et privative sur &eacute;tang de 2 ha, parc d&rsquo;aventure dans les arbres et paintball, poney club, aire de jeux pour les enfants avec ch&acirc;teau gonflable, etc.&nbsp;</p>', 272, 272, 9, 'Porte de Vanves', '46.642441903366844', '-1.7106581105361598', 10, NULL, NULL, NULL, NULL, 400.00, 350.00, NULL, 0, 0, 7, 8, 9, 200, NULL, '[{\"name\":\"Lawn garden\",\"name_en\":null,\"price\":\"100\",\"type\":\"one_time\"},{\"name\":\"Clearning\",\"name_en\":null,\"price\":\"100\",\"type\":\"one_time\"},{\"name\":\"Breakfasts\",\"name_en\":null,\"price\":\"200\",\"type\":\"one_time\"}]', NULL, 'publish', 1, 19, 1, NULL, '2022-04-14 05:22:07', '2022-05-05 21:59:56', 0.0, NULL, NULL, NULL, NULL, NULL, NULL),
(10, 'L\'ECOLODGE', 'ecolodge', '<p>Vous allez &ecirc;tre blottis dans des logements atypiques, au creux de la Nature, avec la faune et la flore.</p>', 273, 273, 1, 'Gorges de Verdon', '43.749645190453265', '6.219473235686494', 8, 1, NULL, NULL, NULL, 225.00, 0.00, NULL, 0, 0, 6, 6, 4, 100, NULL, '[{\"name\":\"Lawn garden\",\"name_en\":null,\"price\":\"100\",\"type\":\"one_time\"},{\"name\":\"Clearning\",\"name_en\":null,\"price\":\"100\",\"type\":\"one_time\"},{\"name\":\"Breakfasts\",\"name_en\":null,\"price\":\"200\",\"type\":\"one_time\"}]', NULL, 'publish', 1, 17, 1, NULL, '2022-04-14 05:22:07', '2022-05-03 12:57:03', 0.0, NULL, NULL, NULL, NULL, NULL, NULL),
