INSERT INTO `bravo_space_translations` (`id`, `origin_id`, `locale`, `title`, `content`, `faqs`, `address`, `create_user`, `update_user`, `deleted_at`, `created_at`, `updated_at`, `surrounding`) VALUES
(1, 9, 'en', 'THE CLEMENT HOUSE', '<p>The CLÉMENT house, in Vendée, is located 12 km from the sea.</p>\n<p>The domain offers an aquatic area, a paddling pool, water slides, free and private fishing on a 2 ha pond, adventure park in the trees and paintball, pony club, playground for children with a bouncy castle, etc. </p>', NULL, 'Porte de Vanves', 1, 1, NULL, '2022-05-03 12:52:05', '2022-05-03 12:52:21', NULL),
(2, 7, 'en', 'DOMAINE DES VAULX', '<p>5 CABINS IN THE TREES including 1 family, 1 CABIN FLOTTANTE, 1 BUBBLE, 1 LOV\'NID SPA, 1 CABANE PERCHEE SPA on the road to BRITAIN at the gateway to NORMANDY. Located in Mayenne (53), in the heart of the Ernée valley, at La Baconnière, our accommodations are on the way to Mont St-Michel, Fougères, Vitré, Cancale, Saint-Malo.</p>\n<p>Do you want to be in the country ?</p>', NULL, 'Haras de la Poupardière 53240, La Baconnière', 1, NULL, NULL, '2022-05-03 12:55:10', '2022-05-03 12:55:10', NULL),
(3, 10, 'en', 'L\'ECOLODGE', '<p>Vous allez être blottis dans des logements atypiques, au creux de la Nature, avec la faune et la flore.</p>', NULL, 'Gorges de Verdon', 1, NULL, NULL, '2022-05-03 12:57:22', '2022-05-03 12:57:22', NULL),
(4, 5, 'en', 'LA CHOUETTE CABANE', '<div style=\"white-space:pre-wrap;\"><span style=\"white-space:pre-wrap;\">25 hectares shared between various ponds, market gardens, green paths in the shade of trees. </span></div>\n<div style=\"white-space:pre-wrap;\"> </div>\n<div style=\"white-space:pre-wrap;\"><span style=\"white-space:pre-wrap;\">Gwendolyne will welcome you with joy in this haven of peace for a privileged moment spent between lovers, friends or family. Our cabins and caravans are fully insulated and heated for the winter, care is taken to the quality of the bedding, linen, refined decoration. Books and binoculars are at your disposal in your cabin. An exceptional place for the diversity of the fauna and the comfort of the accommodation.</span></div>', NULL, 'La basse bergerie, 53400, Pommerieux, Pays de la Loire', 1, NULL, NULL, '2022-05-03 12:59:34', '2022-05-03 12:59:34', NULL);
