(8, 'Pourquoi choisir Laravel ?', '<p>Pourquoi avons-nous choisi Laravel pour notre projet ?&nbsp;</p>\r\n<p>La r&eacute;ponse est assez simple... Laravel est probablement le meilleur framework PHP, qui a fait ses preuves en termes de fiabilit&eacute; et d\'optimisation.</p>\r\n<p>Laravel est facile &agrave; coder et ses biblioth&egrave;ques contiennent d&eacute;j&agrave; des packages pour des fonctionnalit&eacute;s telles que le paiement en ligne, les cadres de conception externes, etc.</p>\r\n<p>&nbsp;</p>', 'laravel', 'publish', 7, 274, 1, 1, NULL, NULL, NULL, '2022-03-09 06:22:05', '2022-03-23 11:34:32');
