INSERT INTO `core_news_translations` (`id`, `origin_id`, `locale`, `title`, `content`, `create_user`, `update_user`, `created_at`, `updated_at`) VALUES
(1, 8, 'en', 'Why choose Laravel?', '<p>Why did we choose Laravel for our project? </p>\n<p>The answer is quite simple... Laravel is probably the best PHP framework which has proven to be reliable and optimized.</p>\n<p>Laravel is easy to write code on and its libraries already have packages for features like online payment, external design frameworks and more.</p>\n<p> </p>', 1, NULL, '2022-05-03 10:34:03', '2022-05-03 10:34:03');
