(5, 'partner', 'Partner', NULL, NULL, 'publish', NULL, NULL, 5, 1, 1, NULL, NULL, NULL, '2022-04-14 05:22:04', '2022-04-14 08:39:11', 'normal', NULL),
(9, 'privacy-policy', 'Privacy Policy for AtypikHouse', '<p>AtypikHouse is a year-long (2022) project of F2I digital school graduates:</p>\n<ul>\n<li>Vasylyshyn Roman.</li>\n<li>Dienaba Camara.</li>\n<li>Issa Barry.</li>\n<li>Cedric HIHEGLO HODEWA</li>\n</ul>\n<p> </p>\n<p>AtypikHouse F2I Project 2022, available at https://f2i-dev2-dc-ib-rv-ch.fr/. All information on the site is used for demonstration purposes and is taken from public sources. That said, one of our top priorities is the privacy of our visitors. This privacy policy document outlines the types of information that F2I Project 2022 collects and records and how we use it.</p>\n<p>If you have additional questions or require more information about our Privacy Policy, do not hesitate to contact us.</p>\n<p>This Privacy Policy applies only to our online activities and is valid for visitors to our website with regards to the information that they shared and/or collect in F2I Project 2022. This policy is not applicable to any information collected offline or via channels other than this website.</p>\n<h2>Consent</h2>\n<p>By using our website, you hereby consent to our Privacy Policy and agree to its terms.</p>\n<h2>Information we collect</h2>\n<p>The personal information that you are asked to provide, and the reasons why you are asked to provide it, will be made clear to you at the point we ask you to provide your personal information.</p>\n<p>If you contact us directly, we may receive additional information about you such as your name, email address, phone number, the contents of the message and/or attachments you may send us, and any other information you may choose to provide.</p>\n<p>When you register for an Account, we may ask for your contact information, including items such as name, company name, address, email address, and telephone number.</p>\n<h2>How we use your information</h2>\n<p>We use the information we collect in various ways, including to:</p>\n<ul>\n<li>Provide, operate, and maintain our website</li>\n<li>Improve, personalize, and expand our website</li>\n<li>Understand and analyze how you use our website</li>\n<li>Develop new products, services, features, and functionality</li>\n<li>Communicate with you, either directly or through one of our partners, including for customer service, to provide you with updates and other information relating to the website, and for marketing and promotional purposes</li>\n<li>Send you emails</li>\n<li>Find and prevent fraud</li>\n</ul>\n<h2>Log Files</h2>\n<p>F2I Project 2022 follows a standard procedure of using log files. These files log visitors when they visit websites. All hosting companies do this and a part of hosting services\' analytics. The information collected by log files include internet protocol (IP) addresses, browser type, Internet Service Provider (ISP), date and time stamp, referring/exit pages, and possibly the number of clicks. These are not linked to any information that is personally identifiable. The purpose of the information is for analyzing trends, administering the site, tracking users\' movement on the website, and gathering demographic information.</p>\n<h2>Cookies and Web Beacons</h2>\n<p>Like any other website, F2I Project 2022 uses \'cookies\'. These cookies are used to store information including visitors\' preferences, and the pages on the website that the visitor accessed or visited. The information is used to optimize the users\' experience by customizing our web page content based on visitors\' browser type and/or other information.</p>\n<h2>Advertising Partners Privacy Policies</h2>\n<p>You may consult this list to find the Privacy Policy for each of the advertising partners of F2I Project 2022.</p>\n<p>Third-party ad servers or ad networks uses technologies like cookies, JavaScript, or Web Beacons that are used in their respective advertisements and links that appear on F2I Project 2022, which are sent directly to users\' browser. They automatically receive your IP address when this occurs. These technologies are used to measure the effectiveness of their advertising campaigns and/or to personalize the advertising content that you see on websites that you visit.</p>\n<p>Note that F2I Project 2022 has no access to or control over these cookies that are used by third-party advertisers.</p>\n<h2>Third Party Privacy Policies</h2>\n<p>F2I Project 2022\'s Privacy Policy does not apply to other advertisers or websites. Thus, we are advising you to consult the respective Privacy Policies of these third-party ad servers for more detailed information. It may include their practices and instructions about how to opt-out of certain options.</p>\n<p>You can choose to disable cookies through your individual browser options. To know more detailed information about cookie management with specific web browsers, it can be found at the browsers\' respective websites.</p>\n<h2>CCPA Privacy Rights (Do Not Sell My Personal Information)</h2>\n<p>Under the CCPA, among other rights, California consumers have the right to:</p>\n<p>Request that a business that collects a consumer\'s personal data disclose the categories and specific pieces of personal data that a business has collected about consumers.</p>\n<p>Request that a business delete any personal data about the consumer that a business has collected.</p>\n<p>Request that a business that sells a consumer\'s personal data, not sell the consumer\'s personal data.</p>\n<p>If you make a request, we have one month to respond to you. If you would like to exercise any of these rights, please contact us.</p>\n<h2>GDPR Data Protection Rights</h2>\n<p>We would like to make sure you are fully aware of all of your data protection rights. Every user is entitled to the following:</p>\n<p>The right to access – You have the right to request copies of your personal data. We may charge you a small fee for this service.</p>\n<p>The right to rectification – You have the right to request that we correct any information you believe is inaccurate. You also have the right to request that we complete the information you believe is incomplete.</p>\n<p>The right to erasure – You have the right to request that we erase your personal data, under certain conditions.</p>\n<p>The right to restrict processing – You have the right to request that we restrict the processing of your personal data, under certain conditions.</p>\n<p>The right to object to processing – You have the right to object to our processing of your personal data, under certain conditions.</p>\n<p>The right to data portability – You have the right to request that we transfer the data that we have collected to another organization, or directly to you, under certain conditions.</p>\n<p>If you make a request, we have one month to respond to you. If you would like to exercise any of these rights, please contact us.</p>\n<h2>Children\'s Information</h2>\n<p>Another part of our priority is adding protection for children while using the internet. We encourage parents and guardians to observe, participate in, and/or monitor and guide their online activity.</p>\n<p>F2I Project 2022 does not knowingly collect any Personal Identifiable Information from children under the age of 13. If you think that your child provided this kind of information on our website, we strongly encourage you to contact us immediately and we will do our best efforts to promptly remove such information from our records.</p>', NULL, 'publish', NULL, NULL, NULL, 1, 1, NULL, NULL, NULL, '2022-04-14 05:22:04', '2022-04-14 11:55:00', 'normal', NULL),
(10, 'a-propos-de-nous', 'À PROPOS DE NOUS', '<div style=\"white-space:pre-wrap;\"> </div>\n<h5 style=\"white-space:pre-wrap;text-align:left;\">Histoire de la création d’AtypikHouse</h5>\n<div style=\"white-space:pre-wrap;text-align:left;\">\n<p>AtypikHouse est une nouvelle société dans le domaine de la location d’habitations insolites, située à Pierrefonds dans l’Oise (60). Elle est composée de trois associés:</p>\n<ul>\n<li>Matthieu Cortot,</li>\n<li>Chloé Badeaux,</li>\n<li>Alex Roatta,</li>\n</ul>\n<p>Après avoir collaboré sur divers événements ensemble, et effectué de nombreux voyages, ils décident de s’associer pour créer la société Atypik House. La société se base sur la location d’habitations insolites, comme les cabanes dans les arbres, les yourtes, les cabanes flottantes et autres logements insolites.</p>\n</div>', NULL, 'publish', NULL, 277, NULL, 19, 19, NULL, NULL, NULL, '2022-05-04 14:11:13', '2022-05-04 14:53:45', 'normal', NULL);
